eval("__webpack_require__.a(module, async (__webpack_handle_async_dependencies__, __webpack_async_result__) => { try {\n__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   projectsData: () => (/* binding */ projectsData)\n/* harmony export */ });\n/* harmony import */ var uuid__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! uuid */ \"uuid\");\n/* harmony import */ var _public_images___WEBPACK_IMPORTED_MODULE_1__ = __webpack_require__(/*! ../public/images/ */ \"./public/images/index.jsx\");\nvar __webpack_async_dependencies__ = __webpack_handle_async_dependencies__([uuid__WEBPACK_IMPORTED_MODULE_0__]);\nuuid__WEBPACK_IMPORTED_MODULE_0__ = (__webpack_async_dependencies__.then ? (await __webpack_async_dependencies__)() : __webpack_async_dependencies__)[0];\n\n\nconst projectsData = [\n    {\n        id: 1,\n        title: \"The Paradox of Knowledge Handoffs\",\n        url: \"the-paradox-of-knowledge-handoffs\",\n        category: \"Working principles\",\n        img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].thumbnail,\n        ProjectHeader: {\n            title: \"The Paradox of Knowledge Handoffs\",\n            publishDate: \"Jul 2023\",\n            description: \"This case study discusses my experience at Insendi, focusing on the challenges of knowledge handover and the importance of collective learning for effective product development.\"\n        },\n        ProjectInfo: {\n            ProjectDetailsHeading: \"\",\n            ProjectDetails: [\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"quote\",\n                    title: \"\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"How can I claim expertise in designing experiences if I can't effectively create a knowledge-sharing process that shapes our product development?\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"allDetails\",\n                    title: \"A Team in Flux\",\n                    img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].team,\n                    imgHi: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].teamHi,\n                    alt: \"product team Gran Canaria 2022\",\n                    body: \"I stepped into my role as product designer during a period of significant upheaval. A newly-appointed CTO had just arrived, accompanied by a fresh team of product managers and a technical director. Amidst this flux, the air was rife with speculation about the future of Insendi's product, vision, and strategy. Conversations were swirling around the idea of dividing Insendi into three distinct applications, each tailored to a specific Job To Be Done (JTBD).\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"The coordinator's job to be done\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"When a student cohort wants to enrol on an online course, help me coordinate and manage student access, faculty support, and course maintenance so that a seamless and effective learning experience is ensured for all stakeholders.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"The Builder's job to be done\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"When tasked with educating a cohort of students through an online or blended format, help me design and structure a comprehensive and coherent course that effectively scaffolds the learning journey so that students can successfully master the subject matter and pass the course.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"The Deliverer's job to be done\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"When the course is live and students are actively participating, help me effectively guide, engage, and assess students throughout their learning journey so that they successfully complete the course and earn meaningful grades.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"textOnly\",\n                    title: \"\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: 'Our team was tasked with the \"Build\" aspect, but the project awaited formal approval. So while we waited the team focused on platform architecture and tech debt removal. The product manager and I had the opportunity to do some initial discovery.'\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"textOnly\",\n                    title: \"\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"Separately the product manager and I dove into understanding our users, I started my focus on one of the archetypical build users—the Learning Designer. Collecting insights and findings from user interviews, research papers, YouTube videos, podcasts, and blogs, I created an in-depth profile for this role. I even mapped out their workflow, identifying where our product could add value.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"allDetails\",\n                    title: \"Learning Designer Archetype\",\n                    img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].personaImage,\n                    imgHi: \"\",\n                    alt: \"Illustration of tech a savvy woman\",\n                    body: \"These professionals collaborate closely with engaged Subject Matter Experts (SMEs) to create inclusive and transformative learning experiences. Passionate and methodical, they are committed to the success of their students.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"ImageOnly\",\n                    title: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].userFlowHi,\n                    img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].userFlow,\n                    imgHi: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].userFlowHi,\n                    alt: \"This map outlines the learning design process for digital online courses, detailing the activities, tools, and touch points with the insendi platform. It also highlights the experience principles being addressed.\",\n                    body: \"\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"allDetails\",\n                    title: \"The Result\",\n                    img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].notes,\n                    imgHi: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].notesHi,\n                    alt: \"Notes from user interviews and workshops clustered into themes\",\n                    body: \"Despite my enthusiasm and the depth of my research, I faced a significant hurdle: a lack of engagement from my team. I got a few likes on Slack and a few kind words, but as a team, we never discussed how these learnings would shape our decision-making.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"quote\",\n                    title: \"\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"How can we build a product that resonates with our users if the team doesn't know what the users needs are?\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"allDetails\",\n                    title: \"A Lesson in Collaborative Learning\",\n                    img: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].persona,\n                    imgHi: _public_images___WEBPACK_IMPORTED_MODULE_1__[\"default\"].personaHi,\n                    alt: \"a proto-persona for a learning designer\",\n                    body: \"Though the project didn't materialise, the experience was far from a waste. It made me realise the importance of collective empathy and understanding. The agile principle of \\\"Working software over comprehensive documentation\\\" took on a new meaning. Documentation, like features, is only useful if engaged with. The real value lies in a team's collective understanding and vision, eliminating the need for exhaustive documentation and leaving more room for actionable insights.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"textOnly\",\n                    title: \"A Continuous Journey of Iteration\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"I carried these lessons forward when working with the team and into my subsequent roles, continually iterating on how I deliver user insights to product teams and departments. Each team and company presents its unique set of challenges and work cultures; there's no one-size-fits-all approach\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"textOnly\",\n                    title: \"Principles for Effective Knowledge Sharing\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"Discover together and often\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"The more you interact with users, the more nuanced your understanding becomes. Invite team members to join these sessions whenever possible.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"Keep it short and frequent\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"Share your insights often but keep them concise. The goal is to disseminate information quickly, so it can be acted upon, and without taking too much time.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"chip\",\n                    title: \"Minimise documentation\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"While it's essential to keep records, don't get bogged down in extensive note-taking. Focus on learning what needs to be known and sharing it promptly with those who would benefit.\"\n                },\n                {\n                    id: (0,uuid__WEBPACK_IMPORTED_MODULE_0__.v4)(),\n                    styleID: \"textOnly\",\n                    title: \"\",\n                    img: \"\",\n                    imgHi: \"\",\n                    alt: \"\",\n                    body: \"By adhering to these principles, I've been able to adapt to different team dynamics and company cultures while keeping the focus on what truly matters: building products that resonate with users. The journey of fostering collective empathy and understanding within a team is ongoing, but these principles I find myself working on these continually.\"\n                }\n            ]\n        }\n    }\n];\n\n__webpack_async_result__();\n} catch(e) { __webpack_async_result__(e); } });//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/projectsData.js\n");

